  return (
    <div>
      <div className='player'>
        <h3>Teaser: Juro que es Posta</h3>
        <h4>Posta</h4>
      </div>

      <style jsx>{`
        .player {
          background: #131414;
          position: fixed;
          height: 120px;
          right: 0;
          left: 0;
          bottom: 0;
          border-radius: 20px 20px 0 0;
        }
        h3 {
          color: #fff;
        }
        h4 {
          color: #a8a8a8;
        }
      `}</style>
    </div>
  );
}
